import React, { useState } from 'react';
// import './App.css';

const CompanyDetailsForm = () => {
  const [formData, setFormData] = useState({
    name: '',
    batch: '',
    address: {
      blockNo: '',
      buildingName: '',
      area: '',
      landmark: '',
      state: '',
      city: '',
      pincode: '',
    },
    contactPerson: {
      name: '',
      designation: '',
      email: '',
      mobile: '',
    },
    designations: [],
  });

  const [newDesignation, setNewDesignation] = useState({
    designation: '',
    package: '',
    bond: '',
    location: '',
    requiredQualifications: '',
    placementProcess: [],
  });

  const [newProcess, setNewProcess] = useState({
    roundNumber: '',
    round: '',
    description: '',
  });

  const handleChange = (e, section, subsection) => {
    const { name, value } = e.target;

    if (subsection) {
      setFormData((prevState) => ({
        ...prevState,
        [section]: {
          ...prevState[section],
          [subsection]: {
            ...prevState[section][subsection],
            [name]: value,
          },
        },
      }));
    } else if (section) {
      setFormData((prevState) => ({
        ...prevState,
        [section]: {
          ...prevState[section],
          [name]: value,
        },
      }));
    } else {
      setFormData((prevState) => ({
        ...prevState,
        [name]: value,
      }));
    }
  };

  const handleAddDesignation = () => {
    setFormData((prevState) => ({
      ...prevState,
      designations: [...prevState.designations, newDesignation],
    }));
    setNewDesignation({
      designation: '',
      package: '',
      bond: '',
      location: '',
      requiredQualifications: '',
      placementProcess: [],
    });
  };

  const handleAddProcess = () => {
    setNewDesignation((prevState) => ({
      ...prevState,
      placementProcess: [...prevState.placementProcess, newProcess],
    }));
    setNewProcess({
      roundNumber: '',
      round: '',
      description: '',
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost:5000/api/companies', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        const data = await response.json();
        console.log('Response:', data);
        alert('Company details submitted successfully!');
      } else {
        console.error('Error:', response.statusText);
        alert('Failed to submit the form.');
      }
    } catch (error) {
      console.error('Error submitting data:', error);
      alert('An error occurred while submitting the form.');
    }
  };

  return (
    <div className="App">
      <h1>Company Details Form</h1>
      <form onSubmit={handleSubmit}>
        {/* Company Info */}
        <div>
          <label>Company Name: </label>
          <input
            type="text"
            name="name"
            value={formData.name}
            onChange={(e) => handleChange(e)}
            required
          />
        </div>
        <div>
          <label>Batch: </label>
          <input
            type="text"
            name="batch"
            value={formData.batch}
            onChange={(e) => handleChange(e)}
            required
          />
        </div>

        {/* Address */}
        <fieldset>
          <legend>Address</legend>
          <input
            type="text"
            placeholder="Block No"
            name="blockNo"
            value={formData.address.blockNo}
            onChange={(e) => handleChange(e, 'address')}
          />
          <input
            type="text"
            placeholder="Building Name"
            name="buildingName"
            value={formData.address.buildingName}
            onChange={(e) => handleChange(e, 'address')}
          />
          <input
            type="text"
            placeholder="Area"
            name="area"
            value={formData.address.area}
            onChange={(e) => handleChange(e, 'address')}
          />
          <input
            type="text"
            placeholder="Landmark"
            name="landmark"
            value={formData.address.landmark}
            onChange={(e) => handleChange(e, 'address')}
          />
          <input
            type="text"
            placeholder="City"
            name="city"
            value={formData.address.city}
            onChange={(e) => handleChange(e, 'address')}
          />
          <input
            type="text"
            placeholder="State"
            name="state"
            value={formData.address.state}
            onChange={(e) => handleChange(e, 'address')}
          />
          <input
            type="text"
            placeholder="Pincode"
            name="pincode"
            value={formData.address.pincode}
            onChange={(e) => handleChange(e, 'address')}
          />
        </fieldset>

        {/* Contact Person */}
        <fieldset>
          <legend>Contact Person</legend>
          <input
            type="text"
            placeholder="Name"
            name="name"
            value={formData.contactPerson.name}
            onChange={(e) => handleChange(e, 'contactPerson')}
            required
          />
          <input
            type="text"
            placeholder="Designation"
            name="designation"
            value={formData.contactPerson.designation}
            onChange={(e) => handleChange(e, 'contactPerson')}
            required
          />
          <input
            type="email"
            placeholder="Email"
            name="email"
            value={formData.contactPerson.email}
            onChange={(e) => handleChange(e, 'contactPerson')}
            required
          />
          <input
            type="text"
            placeholder="Mobile"
            name="mobile"
            value={formData.contactPerson.mobile}
            onChange={(e) => handleChange(e, 'contactPerson')}
            required
          />
        </fieldset>

        {/* Designations */}
        <fieldset>
          <legend>Designations</legend>
          <input
            type="text"
            placeholder="Designation"
            name="designation"
            value={newDesignation.designation}
            onChange={(e) => setNewDesignation({ ...newDesignation, designation: e.target.value })}
          />
          <input
            type="text"
            placeholder="Package"
            name="package"
            value={newDesignation.package}
            onChange={(e) => setNewDesignation({ ...newDesignation, package: e.target.value })}
          />
          <input
            type="text"
            placeholder="Bond"
            name="bond"
            value={newDesignation.bond}
            onChange={(e) => setNewDesignation({ ...newDesignation, bond: e.target.value })}
          />
          <input
            type="text"
            placeholder="Location"
            name="location"
            value={newDesignation.location}
            onChange={(e) => setNewDesignation({ ...newDesignation, location: e.target.value })}
          />
          <textarea
            placeholder="Required Qualifications (comma separated)"
            name="requiredQualifications"
            value={newDesignation.requiredQualifications}
            onChange={(e) =>
              setNewDesignation({ ...newDesignation, requiredQualifications: e.target.value })
            }
          />
          {/* Placement Process */}
          <fieldset>
            <legend>Placement Process</legend>
            <input
              type="number"
              placeholder="Round Number"
              name="roundNumber"
              value={newProcess.roundNumber}
              onChange={(e) => setNewProcess({ ...newProcess, roundNumber: e.target.value })}
            />
            <input
              type="text"
              placeholder="Round Name"
              name="round"
              value={newProcess.round}
              onChange={(e) => setNewProcess({ ...newProcess, round: e.target.value })}
            />
            <textarea
              placeholder="Description"
              name="description"
              value={newProcess.description}
              onChange={(e) => setNewProcess({ ...newProcess, description: e.target.value })}
            />
            <button type="button" onClick={handleAddProcess}>
              Add Process
            </button>
          </fieldset>
          <button type="button" onClick={handleAddDesignation}>
            Add Designation
          </button>
        </fieldset>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default App;
